import React, { Component } from 'react'

class Dialog extends Component{
    constructor(props){
      super(props)
      this.state = {
        hidden: false
      }
    }

    hide = () => {
      this.setState({
        hidden: true
      })
    }

    render() {
        return (
          <div className={this.state.hidden? "modal invisible": "modal"} tabindex="-1" role="dialog">
            <div className="modal-dialog" role="document">
              <div className="modal-content">
                <div className="modal-header">
                  <h5 className="modal-title">{this.props.title}</h5>
                  <button type="button" className="close" data-dismiss="modal" aria-label="Close" onClick={this.hide}>
                    <span aria-hidden="true">&times;</span>
                  </button>
                </div>
                <div className="modal-body">
                  <p>{this.props.body}</p>
                </div>
                <div className="modal-footer">
                  <button type="button" className="btn active">{this.props.buttonText}</button>
                </div>
              </div>
            </div>
          </div>
        )
    }
}

export default Dialog
